# react-image-base64

Base64React

# DEMO

https://isystk.github.io/react-image-base64

# Features

- Base64JSON
- 
- HEICJPEG

# Requirement

* heic2any 0.0.3

# Installation

```bash
yarn add -D react-image-base64
```

# Usage

```bash
git clone https://github.com/isystk/react-image-base64.git
cd react-image-base64
yarn run start
```

# Note

```
  const [images, setImages] = useState({data: []});
  const [errors, setErrors] = useState([]);

  return (
    <div>
      <ReactImageBase64
        maxFileSize={10485760}
        thumbnail_size={100}
        drop={true}
        dropText=""
        capture="environment"
        multiple={true}
        handleChange={data => {
          if (data.result) {
            let list =images.data
            list.push(data);
            setImages({data: list})
          } else {
            setErrors([...errors, data.messages]);
          }
        }}
      />
      { errors.map((error, index) => 
          <p className="error-message" key={index}>{error}</p>
        )
      }
    </div>
  )
```

